import React, { Component } from "react";
import axios from "axios";
import App from "../App";
export default class Board extends Component {
  constructor(props) {
    super();
    this.numbers = this.props.numbers;
  }
  componentDidMount = () => {};

  render() {
    return (
      <React.Fragment>
        <div>{this.numbers[0]}</div>
      </React.Fragment>
    );
  }
}
